import { useState, useEffect } from "react";
import { Menu, Search, ShoppingCart, User } from "lucide-react";

export default function Header() {
  const [isScrolled, setIsScrolled] = useState(false);
  const [isMenuOpen, setIsMenuOpen] = useState(false);

  useEffect(() => {
    const handleScroll = () => {
      setIsScrolled(window.scrollY > 20);
    };
    window.addEventListener("scroll", handleScroll);
    return () => window.removeEventListener("scroll", handleScroll);
  }, []);

  return (
    <header
      className={`sticky top-0 z-50 transition-all duration-300 ${
        isScrolled ? "bg-white shadow-lg" : "bg-gray-50"
      }`}
    >
      <div className="max-w-7xl mx-auto px-6">
        <div className="flex items-center justify-between py-4">
          
          {/* Logo */}
          <div className="flex items-center space-x-2">
            <span className="text-2xl font-bold text-gray-900">MoShop</span>
          </div>

          {/* Menu (Desktop) */}
          <nav className="hidden md:flex space-x-8">
            <a href="#" className="text-gray-700 hover:text-black">Accueil</a>
            <a href="#" className="text-gray-700 hover:text-black">Hommes</a>
            <a href="#" className="text-gray-700 hover:text-black">Femmes</a>
            <a href="#" className="text-gray-700 hover:text-black">Nouveautés</a>
            <a href="#" className="text-gray-700 hover:text-black">Promotions</a>
          </nav>

          {/* Recherche + Icônes */}
          <div className="hidden md:flex items-center space-x-6">
            {/* Recherche */}
            <div className="relative">
              <input
                type="text"
                placeholder="Rechercher..."
                className="w-48 lg:w-64 px-4 py-2 rounded-full border border-gray-300 focus:outline-none focus:ring-2 focus:ring-black"
              />
              <Search className="absolute right-3 top-2.5 h-5 w-5 text-gray-400" />
            </div>

            {/* Icônes */}
            <button className="p-2 hover:text-black text-gray-700">
              <ShoppingCart className="h-6 w-6" />
            </button>
            <button className="p-2 hover:text-black text-gray-700">
              <User className="h-6 w-6" />
            </button>
          </div>

          {/* Menu Burger (Mobile) */}
          <div className="md:hidden">
            <button
              onClick={() => setIsMenuOpen(!isMenuOpen)}
              className="p-2 text-gray-700 hover:text-black"
            >
              <Menu className="h-6 w-6" />
            </button>
          </div>
        </div>

        {/* Menu Mobile */}
        {isMenuOpen && (
          <div className="md:hidden flex flex-col space-y-4 pb-4">
            <a href="#" className="text-gray-700 hover:text-black">Accueil</a>
            <a href="#" className="text-gray-700 hover:text-black">Hommes</a>
            <a href="#" className="text-gray-700 hover:text-black">Femmes</a>
            <a href="#" className="text-gray-700 hover:text-black">Nouveautés</a>
            <a href="#" className="text-gray-700 hover:text-black">Promotions</a>
            <div className="flex items-center space-x-4 mt-2">
              <button className="p-2 hover:text-black text-gray-700">
                <ShoppingCart className="h-6 w-6" />
              </button>
              <button className="p-2 hover:text-black text-gray-700">
                <User className="h-6 w-6" />
              </button>
            </div>
          </div>
        )}
      </div>
    </header>
  );
}
